import React from "react";

const customer = [
	{ name: "one", phoneNumber: "1238654", gender: "male" },
	{ name: "two", phoneNumber: "1234434", gender: "male" },
	{ name: "three", phoneNumber: "34854354", gender: "female" },
	{ name: "five", phoneNumber: "874365345", gender: "male" },
];

const Customer = () => {
	return (
		<div>
			{customer.map((c) => {
				return <div className="customer-holder">
                    Name:{c.name}
                    Phone number: {}
                     </div>;
			})}
		</div>
	);
};

export default Customer;
